                                                    markdownContent: '# KDE MacOs Temas Kurulum Admlar\n\n\t# Dock\'un ayarlanmas\n\n\t\t# ilk olarak dock zerinde kullanlan widgetlar\'n kurulmas gerekmektedir.\n\t\t# kurulmas gereken widgetler :\n\t\t\t1-) active window control\n\t\t\t2-) application title\n\t\t\t3-) simple datetime\n\n\n\t\t# latte-dock kurulumu\n\t\t\t\n\t\t\t# manjaro iin aadaki komut altrlarak kurulum gerekletirilir :\n\t\t\t\t$ sudo pacman -S latte-dock\n\n\n\t\t# MacOS Layout\'unun import edilmesi\t\t\t\n\t\n\t\t\t# latte-dock uygulamalar mensnden balatlr. \n\t\t\t# alan Dock\'un zerinde herhangi bir yere saa tklanr ardndan "layouts" mens altndaki "Configure..." mensne tklanr.\n\t\t\t# alan sayfada sa tarafta bulunan "import" butonuna tklanr ve "layout" dosyas seilir\n\t\t\t# ardndan sa alt kede yer alan "apply" butonuna baslr.\n\t\t\t# import edilen layout ismi zerine bir kere tklanr ve sa tarafta bulunan switch butonuna baslr  \n\n\n\t# kon kurulumu\n\n\t\t# System Ayarlarna girilier. \n\t\t# Appereance blm altnda Icons Theme ksmna gidilir.\n\t\t# Sa Alt ksmdan "Get New Themes..." butonuna tklanr ve "La Capitaine" isimli icon indirilir\n\t\t# "Get New Themes..." ekran kapatlr. \n\t\t# "La Capitaine" isimli tema grlecektir. zerine tklanr ve sa alttan "Apply" butonuna baslr.\n\n\n\t# Tema kurulumu\n\n\t\t# System Ayarlarna girilier. \n\t\t# Appereance blm altnda Workspace Theme > Desktop Theme ksmna gidilir.\n\t\t# Sa Alt ksmdan "Get New Themes..." butonuna tklanr\n\t\t# "La Capitaine" isimli icon indirilir\n\t\t# "Get New Themes..." ekran kapatlr. \n\t\t# "La Capitaine" isimli tema grlecektir. zerine tklanr ve sa alttan "Apply" butonuna baslr.\n\n\t\t \n\t\t \n',
