                                    markdownContent: "\n# Problem : While installing Spotify from AUR packages it gives an error message as follows\n#     curl-7.54.0.tar.gz ... Passed\n#     curl-7.54.0.tar.gz.asc ... Skipped\n# ==> Verifying source file signatures with gpg...\n#     curl-7.54.0.tar.gz ... FAILED (unknown public key 5CC908FDB71E12C2)\n# ==> ERROR: One or more PGP signatures could not be verified!\n# Solution : The problem is that key required to install package is not installed. To fix that problem \n\n#1) Install the key from a repostiry. Let's say the required key is: <KEY>\n\t$ gpg --keyserver hkp://keyserver.ubuntu.com:80 --receive-keys <KEY>\n\t\n",
