                                    markdownContent: '# Installing Cuda 9.1 on Ubuntu 18.04\n# Reference: https://askubuntu.com/questions/1028830/how-do-i-install-cuda-on-ubuntu-18-04\n\n# Install GCC6 follow instructions felow\n\t# Reference: https://forum.libreelec.tv/thread/12368-fixed-compilation-under-ubuntu-18-04-lts/\n\n\t# update system\n\t\t$ sudo apt update\n\n\t# install gcc and g++ 6\n\t\t$ sudo apt install gcc-6 g++-6\n\n\t# update alternatives\n\t\t$ sudo update-alternatives --install "/usr/bin/gcc" "gcc" "/usr/bin/gcc-6" 60 --slave "/usr/bin/g++" "g++" "/usr/bin/g++-6"\n\t\t$ sudo update-alternatives --config gcc\n\n\t# check versions to verify\n\t\t$ gcc --version\n\t\t$ g++ --version\n',
